import React, { useState } from 'react';

import Navbar from 'react-bootstrap/Navbar';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image';
import Accordion from 'react-bootstrap/Accordion';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

import './App.css';
import './logo.svg';
//import { ReactComponent as Logo } from './logo.svg';

const EtIDNav = () => (
<>
<Navbar bg="dark" variant="dark">
<Navbar.Brand href="#home">
  <img
    alt=""
    src="/logo.svg"
    width="30"
    height="30"
    className="d-inline-block align-top"
  />{' '}
  Eth-ter-I-Die Add logo
</Navbar.Brand>
</Navbar>
</>
);

  //check if need to justufy content below!
const EtIDIntro = () => (
  <Container fluid className="p-3">

  <Row className="justify-content-md-center">
  <Col>centred image and intro text goes here

      </Col>
  </Row>
<br />
    <Row className="justify-content-md-center">
    <Col>
      <Accordion>
        <Card>
          <Card.Header>
            <Accordion.Toggle as={Button} variant="link" eventKey="0">
              Story Time!
            </Accordion.Toggle>
          </Card.Header>
          <Accordion.Collapse eventKey="0">
            <Card.Body>Put in story here of ether it die here </Card.Body>
          </Accordion.Collapse>
        </Card>
        </Accordion>
      </Col>

      </Row>
      <br />

      <Row>
        <Col sm>sm=true</Col>
        <Col sm>sm=true</Col>
        <Col sm><Button type="checkbox" variant="outline-dark" size="lg">MetaMask</Button></Col>
        <Col sm><Button variant="outline-dark" size="lg" disabled>Ledger</Button></Col>
        <Col sm>sm=true</Col>
        <Col sm>sm=true</Col>
        <Col sm>sm=true</Col>
      </Row>




      <ToggleButtonGroup type="checkbox" defaultValue={[1, 3]} className="mb-2">
         <ToggleButton value={1}>Checkbox 1 (pre-checked)</ToggleButton>
         <ToggleButton value={2}>Checkbox 2</ToggleButton>
         <ToggleButton value={3}>Checkbox 3 (pre-checked)</ToggleButton>
       </ToggleButtonGroup>


  </Container>

  );

const App = () => (
    <>
      <EtIDNav />

      <EtIDIntro />
   </>
    );





export default App;
